import React from 'react';

import '../../normalize.scss';
import '../../base.scss';

import Banner from '../../components/Header/Banner';
import View from "../view/view";
import ComponentComoFunciona from '../../components/ComoFunciona';

import imgBanner from '../../components/Header/Banner/destaques/ComoJogar/1280.png'

function ComoFunciona() {
  let contentBanner = "Maecenas malesuada non mauris a auctor nuncfgdfgdfg"
  return (
    <View public={true}>
      <Banner imagemBanner={imgBanner} text={contentBanner} />
      <ComponentComoFunciona />
    </View>
  )
}

export default ComoFunciona;
